import "./Contact.css";

function Contact() {
    return (
        <div className="Contact">
            <h1>Contact Me</h1>
            <div className="ContactButtonContainer">
                <button type="button" className="ContactButton" onClick={(e) => {window.location.href='mailto:aadi.kulsh@gmail.com'}}><i className={"fa-solid fa-envelope"} ></i> Email</button>
                <button type="button" className="ContactButton" onClick={(e) => window.location.href='https://www.linkedin.com/in/aadi-kulsh-98348b29b/'}><i className={"fa-brands fa-linkedin"} ></i> LinkedIn</button>
                <button type="button" className="ContactButton" onClick={(e) => window.location.href='https://github.com/MankyDanky'}><i className={"fa-brands fa-github"} ></i> GitHub</button>
            </div>
        </div>
    );
}

export default Contact
